def doRefresh(weburl, cookie, signature):
	print("刷内...")
	time.sleep(2)
	req = urllib.request.Request(weburl)

	req.add_header("Accept-Encoding", "gzip, deflate")#如果打开需要使用gzip
	req.add_header("User-Agent", "Mozilla/5.0 (iPhone; CPU iPhone OS 7_1 like Mac OS X) AppleWebKit/537.51.2 (KHTML, like Gecko) Mobile/11D167 Mojo/IOS")
	req.add_header("X-Requested-With", "XMLHttpRequest")
	req.add_header("Cookie", cookie)
	req.add_header("Signature", signature)
	req.add_header("Connection", "keep-alive")
	req.add_header("Content-Type", "application/x-www-form-urlencoded")
	response = urllib.request.urlopen(req)
	print(response.status, response.reason)
	text = response.read()
	a = gzip.GzipFile(fileobj = io.BytesIO(text)).read()
	return a.decode('utf-8')

